  // get current year from datetime obj
  const currYear = new Date().getFullYear();

  return (
    <footer>
      <Container>
        <Row>
            <Col className='text-center py-3'>
                <p>Built by Josh Gregory: <a href="https://github.com/joshtype">[My GitHub]</a></p>
                <p>Forked from Brad Traversy: <a href="">[Proshop-v2]</a></p>
            </Col>
        </Row>
      </Container>
    </footer>
  )
}

export default Footer
